import React from "react";
import ReactDOM from "react-dom";
// import pi, { doublePi, triplePi } from "./math";
import * as pi from "./math";

ReactDOM.render(
  <>
    <h1>The value of pi</h1>
    <ul>
      <li>{pi.default}</li>
      <li>{pi.doublePi()}</li>
      <li>{pi.triplePi()}</li>
    </ul>
  </>,
  document.getElementById("root")
);
